import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
export default function Footer() {
  return (
    <>
      <FooterWrapper>
        <FooterContainer>
          <FooterUP>
            <div style={{ marginTop: "36px" }}>Log</div>
            <FooterLinks>
              {Footerdata.map((data, key) => (
                <LinksWrapper key={key}>
                  <strong>{data.title}</strong>
                  {data.links.map((link) => (
                    <FLinks>{link}</FLinks>
                  ))}
                </LinksWrapper>
              ))}
            </FooterLinks>
          </FooterUP>
          <FooterDOWN></FooterDOWN>
        </FooterContainer>
      </FooterWrapper>
    </>
  );
}

const FooterWrapper = styled.div`
  background-color: #040e18;
`;

const FooterContainer = styled.div`
  /* background-color: #fff; */
  margin: 0 auto;
  width: 1172px;
`;
const FooterUP = styled.div`
  display: flex;
  padding-left: 16px;
  padding-right: 16px;
  padding-bottom: 16px;
  padding-top: 64px;
`;
const FooterLinks = styled.div`
  display: flex;
`;
const LinksWrapper = styled.div`
  display: flex;
  flex-direction: column;
  text-align: left;
  padding: 0 28px;

  strong {
    text-transform: uppercase;
    font-size: 16px;
    padding-bottom: 16px;
    padding-top: 36px;
    color: #fff;
    letter-spacing: 2px;
    line-height: 1.2;
  }
`;
const FLinks = styled(Link)`
  color: #fff;
  padding: 9px 0;
  opacity: 0.75;
`;
const FooterDOWN = styled.div``;

const Footerdata = [
  {
    title: "Resources",
    links: ["Blog", "Experts", "Articles", "Examples", "Roadmap!"],
  },
  {
    title: "Learn",
    links: ["Python", "Data Analysis"],
  },

  {
    title: "Company",
    links: [
      "Home",
      "About",
      "Blog",
      "Support",
      "Youtube",
      "Terms & Conditions",
    ],
  },
  {
    title: "Apps",
    links: ["Coming Soon!"],
  },
];
